  img {
    width: 150px;
    height: 150px;
    border-radius: 50%;
    margin-bottom: 20px;
    object-fit: cover;
  }

  h3 {
    color: #FF6B35;
    font-size: 22px;
    margin-bottom: 10px;
  }

  .specialty {
    color: ${props => props.isDark ? '#FFE6D9' : '#666'};
    font-weight: 500;
    margin-bottom: 15px;
  }

  .achievements {
    color: ${props => props.isDark ? '#FFE6D9' : '#666'};
    font-size: 14px;
